export function test(algorithm: (array: Array<number>) => Array<number>, test: Test): boolean {
    const { name, input, output } = test;
    const solution = algorithm(input);
    const valid = solution.length === output.length && solution.every((item, index) => item === output[index]);
    if (valid)
        console.log(`%c\t${name}: ✔\t`, 'background: #006600; color: #FFFFFF; padding: 5px');
    else
        console.log(`%c\t${name}: ✘\t`, 'background: #880000; color: #FFFFFF; padding: 5px');
    return valid;
}

export function executeTestSuite(algorithm: (array: Array<number>) => Array<number>) {
    console.log(`Testing ${algorithm.name} algorithm...`);
    const validity = TESTS.map((t: Test) => ({ [t.name]: test(algorithm, t) }));
    const allValid = validity.every(_ => !!Object.values(_)[0]);
    console.log(`${allValid ? 'ALL TESTS PASSED!!!' : 'TESTS HAVE FAILED!!'}`);
}



export function computeTime(
    algorithm: (array: Array<number>) => Array<number>,
    input: Array<number>
) {
    const t0 = performance.now();
    const solution = algorithm(input);
    const t1 = performance.now();

    const time = (t1 - t0);
    console.log(`${algorithm.name} (${input.length} items) > Solution ${time} ms`);

    return [
        input.length,
        time
    ];
}